import React from 'react'
import './styles.css' ; 
import {Bar} from 'react-chartjs-2' ; 
const App = () => {
    return (
        <Bar 
        data = {{
            labels:["Abhinav" , "Ayush BRO"] ,
        }}
        height = {400}
        widthn = {600}
        />
    )
}

export default App
